import axios from 'axios'
import { API } from '../commons'

interface HomeProps {
  data: any
}

const Home = (props: HomeProps) => {
  const { data: results } = props
  return (
    <>
      <h1>Rick and Morty characters</h1>
      {results.map((r: any) => (<div key={r.id}>{r.name}</div>))}
    </>
  )
}

Home.getInitialProps = async () => {
  try {
    const  response =  await axios.get(API.BASE.characters)
    return { data: response }
  } catch (error) {
    console.log(error)
  }
}

export default Home
